def bacon_strategy(score, opponent_score, margin=8, num_rolls=4):
    """This strategy rolls 0 dice if that gives at least MARGIN points, and
    rolls NUM_ROLLS otherwise.
    """
    # BEGIN PROBLEM 10
    if free_bacon(opponent_score) >= margin:
        return 0
    return num_rolls
    # END PROBLEM 10


def swap_strategy(score, opponent_score, margin=8, num_rolls=4):
    """This strategy rolls 0 dice when it triggers a beneficial swap. It also
    rolls 0 dice if it gives at least MARGIN points and does not trigger a
    non-beneficial swap. Otherwise, it rolls NUM_ROLLS.
    """
    # BEGIN PROBLEM 11
    new_score = score + free_bacon(opponent_score)
    if is_swap(new_score, opponent_score) and (opponent_score > new_score):
        return 0
    elif free_bacon(opponent_score) >= margin and not (is_swap(new_score, opponent_score) and (opponent_score < new_score)):
        return 0
    return num_rolls
    # END PROBLEM 11

