def max_winrate_roll(score, opponent_score):
    #CHECK FOR TABLE 
    if check_win_condition(score, opponent_score) >= 0:
        return 0
    index = (100 * score) + opponent_score
    if index in lookup_table_max_winrate_roll:
        return lookup_table_max_winrate_roll[index]

    max_winrate = -1 #not decided yet
    roll_to_max_winrate = {} #not decided yet
    rolls = 0 #CHANGE TO INCLUDE 0 LATER
    while rolls <= 10:
        winrate = winrate_roll(score, opponent_score, rolls)
        if winrate > max_winrate:
            max_winrate = winrate
            roll_to_max_winrate.update({max_winrate:rolls})
        rolls += 1

    lookup_table_max_winrate_roll.update({index:roll_to_max_winrate[max_winrate]})
    #print(str(index) + ":" + str(roll_to_max_winrate[max_winrate]), end=', ')
    return roll_to_max_winrate[max_winrate]

def write_to_strategy():
    text_file = open("strategy_data/f2.txt", "a+")
    text_file.write("{")
    score, opponent_score = 0, 0
    index = 100 * score + opponent_score
    while index < 9999:
        #print('adding line @ ' + str(index))
        score, opponent_score = index // 100, index % 100
        if index not in lookup_table_max_winrate_roll:
            final_strategy(score, opponent_score)
        text_file.write(str(index) + ":" + str(lookup_table_max_winrate_roll[index]) + ", ")
        index += 1
    text_file.write("9999:0}")
    print(len(lookup_table_max_winrate_roll))
    text_file.close()


